css:
@-moz-document domain("www.techbargains.com") {
#page-content {
    background-color: #333;
}
.deal-feed .deal .content .description {
    color: #d4d6d7;
}
.deal-feed .deal .details {
    color: #307fe2;
}
.deal-feed .deal .content .tags a {
    color: #307fe2;
}
.deal-feed .deal .top-info {
    background-color: #0e0d0d;
    color: #b0b0b0;
}
.deal-feed .deal .top-info a {
    color: #b0b0b0;
}
.deal .price-module .final-price,
.deal-feed .deal .content .price .final-price,
.rail-widget .deal .description .price .final-price {
    color: #e49045;
}
.coupon-btn_wrapper {
    background-color: rgba(0, 0, 0, .25);
}
.coupon-btn_wrapper p {
    color: yellowgreen;
}
.nav-btm-row {
    background-color: #1d1d1d;
}
.nav-top-row {
    background-color: #092844;
}
.nav-search-form input {
    background-color: #0e0d0d;
}
.deal-feed .deal {
    border: 1px solid #777777;
}
.rail-widget .item,
.rail-widget.coupons .coupon_wrapper {
    border: 1px solid #777777;
}
}
